	font-weight: ${Atoms.font.weight.bold};
	line-height: ${Atoms.font.lineHeight.header};
	margin-bottom: ${Atoms.spacing.xxlarge};
`;

export default function H1({
	children,
	id,
}: {
	children: React.ReactNode;
	id?: string;
